import {View, Text, StyleSheet, FlatList} from 'react-native';

var data = [
  {name: 'zaeem ahmad'},
  {name: 'ali'},
  {name: 'talha'},
  {name: 'hassan'},
  {name: ''},
  {name: 'hassan'},
  {name: 'hassan'},
  {name: 'hassan'},
  {name: 'hassan'},
  {name: 'hassan'},
  {name: 'hassan'},
  {name: 'hassan'},
];

const App = () => {
  return(
    <View>
      <FlatList data={data} renderItem={(element) => {
        return (<Text ket={element.index}>{element.item.name}</Text>)
      }}/>
    </View>
  )
}

export default App;

const styles = StyleSheet.create({
  text: {
    backgroundColor: 'green'
  }
});
